import React from 'react';
import './App.css';
import Map from './components/map';


function Welcome(props) {
  return <h1>Hello, {props.name}</h1>;
}

function Button(props) {
  return <button> {props.label} </button>
}

function App() {
  return (
    <div className="App">
      <Welcome name = "Daniel" />

      <header className="App-header">
      <h2>
      <Button label = "Dog"/>
      <Button label = "Cat"/>
      <Button label = "Moose"/>
      <Button label = "Beaver"/>
      </h2>
      <Map />
        {/* <Image /> */}
        <p>
          Hello, world!
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>

    </div>
  );
}

export default App;
